  26, 1987. The pro and c on side of the issue were presented in 10 minute segments
  by Rick Schnaderbeck, Assistant Refuge Manager, Devils Lake WMD, and Don Hultman,
  Refuge Manager, Valley City WMD respectively. Following the debate a seven member
  team discussed the issue utilizing problem solving techniques incorporated from
  an earlier training session. A summary of these events follows .\",\n\t\"license_title\":
